import vuex from 'vuex'
import vue from 'vue'
import user from '@/store/modules/user'
import actions from '@/store/actions'
import mutations from '@/store/mutations'



export default new Vuex.Store({
    modules: {
        user
    },
    actions,
    mutations

})
